import React, { Component } from "react";
import css from './content.custom.css';

export default class Content extends Component {
  render() {
    return (
      <div className="container">
        <div class="row">
          <div className="boxCover">
            <div class="col s4">6-columns (one-half)</div>
            <div class="col s4">6-columns (one-half)</div>
            <div class="col s4">6-columns (one-half)</div>
          </div>
        </div>
      </div>
    );
  }
}
